import React from "react";
import "./Join.css";
import logo from "../../images/logo.png";
const Join = () => {
  return (
    <div className="JoinPage">
      <div className="JoinContainer">
        <img src={logo} alt="logo" />
        <h1>C CHAT</h1>
        <input />
        <button>Login in</button>
      </div>
    </div>
  );
};

export default Join;
